(function(){if(!window.Prism){return}var a=document.createElement("header");if(!String.prototype.trim){String.prototype.trim=function(){return this.replace(/^\s+/g,"").replace(/\s+$/g,"")}}if(!("textContent" in a)&&("innerText" in a)&&Object.defineProperty){Object.defineProperty(Element.prototype,"textContent",{get:function(){return this.innerText},set:function(b){this.innerText=b}})}if(!document.addEventListener&&"textContent" in a){setTimeout(Prism.highlightAll,10)}a.innerHTML="\r\n";if(a.textContent.indexOf("\n")===-1){Prism.hooks.add("after-highlight",function(b){b.element.innerHTML=b.highlightedCode.replace(/\r?\n/g,"<br>")})}})();